import React from 'react';
import { projects } from '../../data';
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';
import { AutoRotatingCarousel } from 'material-auto-rotating-carousel';
import { faExternalLinkAlt } from '@fortawesome/free-solid-svg-icons';
import dashboard from '../../Images/newdashboard.png';
import { Slide } from 'material-auto-rotating-carousel'
const { grey, blue, green } = require('@material-ui/core/colors');
const Button = require('@material-ui/core/Button').default;


const CarouselProjects = ({setIsOpen, isOpen}) => {
    return (
        <div>
            <AutoRotatingCarousel
                // label='Get started'
                open={isOpen}
                onClose={() => setIsOpen(false)}
                onStart={() => setIsOpen(false)}
                style={{ position: 'absolute' }}
            >
                <Slide
                    media={<img style={{width: "100%"}}src={dashboard} />}
                    style={{ backgroundColor: "#F4F4F4", color: "#51595F"}}
                    title='MySchool'
                    subtitle="MySchool is a portfolio-building app for parents and students participating in homeschooling activities. We make it quick and easy to add schoolwork examples or activity information to a printable PDF."
                />
                <Slide
                    media={<img src='http://www.icons101.com/icon_png/size_256/id_80975/GoogleInbox.png' />}
                    mediaBackgroundStyle={{ backgroundColor: blue[400] }}
                    style={{ backgroundColor: blue[600] }}
                    title='Ever wanted to be popular?'
                    subtitle='Well just mix two colors and your are good to go!'
                />
                <Slide
                    media={<img src='http://www.icons101.com/icon_png/size_256/id_76704/Google_Settings.png' />}
                    mediaBackgroundStyle={{ backgroundColor: green[400] }}
                    style={{ backgroundColor: green[600] }}
                    title='May the force be with you'
                    subtitle='The Force is a metaphysical and ubiquitous power in the Star Wars fictional universe.'
                />
            </AutoRotatingCarousel>
        </div>
    )
}

export default CarouselProjects;
